import styled from 'styled-components';

export const Content = styled.div`
    width: 400px;
    background-color: var(--yellow);
    max-height: 100px;
    text-align: center;
    margin-left: 200px;
    border-radius: 0 0 15px 15px;
    vertical-align: middle;
`;
